<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Profile Picture Logo Generator</title>
    <style>
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            max-width: 800px;
            margin: 0 auto;
            padding: 20px;
            background-color: #f5f5f5;
            color: #333;
        }

        h1 {
            color: #2e7d32;
            text-align: center;
            margin-bottom: 30px;
        }

        .container {
            display: flex;
            flex-direction: column;
            align-items: center;
            background-color: white;
            padding: 30px;
            border-radius: 15px;
            box-shadow: 0 5px 15px rgba(0, 0, 0, 0.1);
        }

        .upload-container {
            display: flex;
            flex-direction: column;
            align-items: center;
            width: 100%;
            margin-bottom: 20px;
        }

        .upload-btn {
            padding: 12px 24px;
            background-color: #2e7d32;
            color: white;
            border: none;
            border-radius: 25px;
            cursor: pointer;
            font-size: 16px;
            font-weight: bold;
            margin: 10px 0;
            transition: all 0.3s ease;
        }

        .upload-btn:hover {
            background-color: #1b5e20;
            transform: translateY(-2px);
        }

        .canvas-container {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 20px;
            margin-top: 20px;
        }

        canvas {
            max-width: 300px;
            max-height: 300px;
            border: 2px solid #2e7d32;
            border-radius: 10px;
            box-shadow: 0 3px 10px rgba(0, 0, 0, 0.2);
        }

        .download-btn {
            padding: 12px 24px;
            background-color: #2e7d32;
            color: white;
            border: none;
            border-radius: 25px;
            cursor: pointer;
            font-size: 16px;
            font-weight: bold;
            margin: 20px 0;
            transition: all 0.3s ease;
        }

        .download-btn:hover {
            background-color: #1b5e20;
            transform: translateY(-2px);
        }

        .hidden {
            display: none;
        }

        .info-text {
            text-align: center;
            margin: 10px 0;
            color: #666;
        }

        .preview-container {
            display: flex;
            gap: 20px;
            margin: 20px 0;
            flex-wrap: wrap;
            justify-content: center;
        }

        .preview-item {
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        .preview-label {
            margin-top: 10px;
            font-weight: bold;
        }
    </style>
</head>

<body>
    <div class="container">
        <h1>Profile Picture Logo Generator</h1>
        <p class="info-text">Upload your profile picture and we'll place it in the center of the logo!</p>

        <div class="upload-container">
            <input type="file" id="upload-input" accept="image/*" style="display: none;">
            <button class="upload-btn" id="upload-btn">Upload Profile Picture</button>
        </div>

        <div class="preview-container">
            <div class="preview-item">
                <canvas id="original-canvas" width="300" height="300"></canvas>
                <div class="preview-label">Original Profile Picture</div>
            </div>
            <div class="preview-item">
                <canvas id="logo-canvas" width="300" height="300"></canvas>
                <div class="preview-label">Logo with Profile Picture</div>
            </div>
        </div>

        <button class="download-btn hidden" id="download-btn">Download Logo</button>
    </div>

        // DOM elements
        const uploadBtn = document.getElementById('upload-btn');
        const uploadInput = document.getElementById('upload-input');
        const originalCanvas = document.getElementById('original-canvas');
        const logoCanvas = document.getElementById('logo-canvas');
        const downloadBtn = document.getElementById('download-btn');

        // Original context
        const originalCtx = originalCanvas.getContext('2d');
        originalCtx.fillStyle = '#f5f5f5';
        originalCtx.fillRect(0, 0, originalCanvas.width, originalCanvas.height);
        originalCtx.font = '14px Arial';
        originalCtx.fillStyle = '#666';
        originalCtx.textAlign = 'center';
        originalCtx.fillText('No image uploaded yet', originalCanvas.width / 2, originalCanvas.height / 2);

        // Logo context
        const logoCtx = logoCanvas.getContext('2d');
        logoCtx.fillStyle = '#f5f5f5';
        logoCtx.fillRect(0, 0, logoCanvas.width, logoCanvas.height);
        logoCtx.font = '14px Arial';
        logoCtx.fillStyle = '#666';
        logoCtx.textAlign = 'center';
        logoCtx.fillText('Upload an image to see preview', logoCanvas.width / 2, logoCanvas.height / 2);

        // Event listeners
        uploadBtn.addEventListener('click', () => {
            uploadInput.click();
        });

        uploadInput.addEventListener('change', handleImageUpload);

        downloadBtn.addEventListener('click', () => {
            const link = document.createElement('a');
            link.download = 'profile-logo.png';
            link.href = logoCanvas.toDataURL('image/png');
            link.click();
        });

        // Draw the logo onto the canvas
        function drawLogoOnCanvas() {
            return new Promise((resolve) => {
                const img = new Image();

                // Create a Blob from the SVG string
                const blob = new Blob([logoSVG], { type: 'image/svg+xml' });
                const url = URL.createObjectURL(blob);

                img.onload = () => {
                    logoCtx.clearRect(0, 0, logoCanvas.width, logoCanvas.height);
                    logoCtx.drawImage(img, 0, 0, logoCanvas.width, logoCanvas.height);
                    URL.revokeObjectURL(url);
                    resolve();
                };

                img.src = url;
            });
        }

        // Function to handle image upload
        function handleImageUpload(e) {
            const file = e.target.files[0];
            if (!file) return;

            const reader = new FileReader();
            reader.onload = async (event) => {
                const img = new Image();
                img.onload = async () => {
                    // Draw original image
                    originalCtx.clearRect(0, 0, originalCanvas.width, originalCanvas.height);

                    // Calculate dimensions to fit image in canvas while maintaining aspect ratio
                    const scale = Math.min(
                        originalCanvas.width / img.width,
                        originalCanvas.height / img.height
                    ) * 1;

                    const width = img.width * scale;
                    const height = img.height * scale;
                    const x = (originalCanvas.width - width) / 2;
                    const y = (originalCanvas.height - height) / 2;

                    originalCtx.drawImage(img, x, y, width, height);

                    // Draw logo first
                    await drawLogoOnCanvas();

                    // Then draw the profile picture in the center circle
                    // The center circle is approximately at coordinates (250, 195) with radius ~60
                    // We need to scale this to our canvas size
                    const canvasRatio = logoCanvas.width / 500;
                    const centerX = 250 * canvasRatio;
                    const centerY = 250 * canvasRatio;
                    const circleRadius = 150 * canvasRatio;

                    // Create circular clipping path
                    logoCtx.save();
                    logoCtx.beginPath();
                    logoCtx.arc(centerX, centerY, circleRadius, 0, Math.PI * 2);
                    logoCtx.clip();

                    // Calculate dimensions to fit image in circle while maintaining aspect ratio
                    const circleScale = Math.min(
                        circleRadius * 2 / img.width,
                        circleRadius * 2 / img.height
                    );

                    const circleWidth = img.width * circleScale;
                    const circleHeight = img.height * circleScale;
                    const circleX = centerX - circleWidth / 2;
                    const circleY = centerY - circleHeight / 2;

                    // Draw profile picture inside the circle
                    logoCtx.drawImage(img, circleX, circleY, circleWidth, circleHeight);
                    logoCtx.restore();

                    // Show download button
                    downloadBtn.classList.remove('hidden');
                };

                img.src = event.target.result;
            };

            reader.readAsDataURL(file);
        }
    </script>
</body>
